import logo from './logo.svg';
import './App.css';

function clickMe(){
  alert('You clicked Idas button!')
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Hello world 
        <button onClick={clickMe}>
         Ida
       </button>
      );
      </header>
    </div>
  );
}

export default App;
